import React, { useState } from "react";
import axios from "axios";

const Users = () => {
  const [tableName, setTableName] = useState("");
  const [columns, setColumns] = useState([]);
  const [inputValue, setInputValue] = useState("");
  const [sourceDefinition, setSourceDefinition] = useState({
    Name: "",
    columns: [],
  });
  const [selectedColumn, setSelectedColumn] = useState("");
  const [newColumnName, setNewColumnName] = useState("");
  const [newColumnType, setNewColumnType] = useState("");

  // UDPGRADE TO MULTIPLE SELECTIONS
  const [selectedColumns, setSelectedColumns] = useState([]);

  const handleColumnSelect2 = (column_name) => {
    setSelectedColumns([...selectedColumns, column_name]);
  };
  const fetchColumns = async () => {
    try {
      const response = await axios.get(`http://localhost:8800/`);
      const columns = response.data.map((col) => ({
        column_name: col.column_name,
        data_type: col.data_type,
      }));
      setColumns(columns);
      setSourceDefinition({
        ...sourceDefinition,
        columns: columns,
      });
    } catch (error) {
      console.log(error);
    }
  };

  const handleColumnSelect = (column_name) => {
    setSelectedColumn(column_name);
  };

  const handleUpdate = () => {};

  const handleDownload1 = async () => {
    try {
      // Create a new object with the modified sourceDefinition
      const updatedSourceDefinition = {
        Name: tableName,
        SourceDB: "test", // Database Name
        SourceDefinition: sourceDefinition.SourceDB,
        columns: [...sourceDefinition.columns],
      };
      updatedSourceDefinition.columns = updatedSourceDefinition.columns.map(
        (col) => {
          if (col.column_name === selectedColumn) {
            return {
              ...col,
              // Update the column name and data type based on user input
              column_name: newColumnName,
              data_type: newColumnType,
            };
          }
          return col;
        }
      );

      // Convert the updated sourceDefinition to JSON format
      const json = JSON.stringify(updatedSourceDefinition, null, 2);

      // Download the file
      const url = window.URL.createObjectURL(new Blob([json]));
      const link = document.createElement("a");
      link.href = url;
      link.setAttribute("download", "output.json");
      document.body.appendChild(link);
      link.click();
    } catch (error) {
      console.log(error);
    }
  };
  const handleChange = (event) => {
    setInputValue(event.target.value);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    const value = inputValue;
    // Send inputValue to server using fetch or axios
    const response = await axios.post("http://localhost:8800/", { value });
    console.log(response.data);
  };
  const handleDownload2 = async () => {
    try {
      // Create a new object with the selected columns
      const selectedColumnsObj = {
        Name: tableName,
        SourceDB: "test", // Database Name
        SourceDefinition: sourceDefinition.SourceDB,
        columns: sourceDefinition.columns.filter((col) =>
          selectedColumns.includes(col.column_name)
        ),
      };

      // Convert the selectedColumnsObj to JSON format
      const json = JSON.stringify(selectedColumnsObj, null, 2);

      // Download the file
      const url = window.URL.createObjectURL(new Blob([json]));
      const link = document.createElement("a");
      link.href = url;
      link.setAttribute("download", "output.json");
      document.body.appendChild(link);
      link.click();
    } catch (error) {
      console.log(error);
    }
  };
  return (
    <div>
      <h1>Table Name:</h1>
      <form onSubmit={handleSubmit}>
        <input type="text" value={inputValue} onChange={handleChange} />
        <button type="submit">Submit</button>
      </form>
      <h1>Load Table:</h1>
      <input
        type="text"
        value={tableName}
        onChange={(e) => setTableName(e.target.value)}
      />
      <button onClick={fetchColumns}>Fetch Columns</button>
      <br />
      <h1>Columns:</h1>
      <ul>
        {columns.map((col) => (
          <li key={col.column_name}>
            {col.column_name} ({col.data_type})
            <button onClick={() => handleColumnSelect2(col.column_name)}>
              Select
            </button>
          </li>
        ))}
      </ul>
      <h1>Selected Columns:</h1>
      <ul>
        {selectedColumns.map((column, index) => (
          <li key={index}>{column}</li>
        ))}
      </ul>
      {selectedColumns && (
        <>
          <h1>Edit Column:</h1>
          <p>Column Name: {selectedColumn}</p>
          <label>
            New Column Name:
            <input
              type="text"
              value={newColumnName}
              onChange={(e) => setNewColumnName(e.target.value)}
            />
          </label>
          <br />
          <label>
            New Column Type:
            <input
              type="text"
              value={newColumnType}
              onChange={(e) => setNewColumnType(e.target.value)}
            />
          </label>
          <br />
          <button onClick={handleUpdate}>Update Column</button>
          <br />
          <button onClick={handleDownload2}>Download JSON</button>
        </>
      )}
      <br />
    </div>
  );
};

export default Users;
